import React, { Component } from 'react';
import { Text,StyleSheet, TouchableOpacity, ToastAndroid, Platform, AlertIOS, View } from 'react-native';
import { Container, Header, Left, Body, Right, Button, Icon, Title, Item, Input } from 'native-base';

export default class NotificationScreen extends Component {

    searchPage(){
        if(Platform.OS === 'android'){
            ToastAndroid.show("Search Page Navigation", ToastAndroid.SHORT)
        }
        else if(Platform.OS === 'ios'){
            AlertIOS.alert('Search Page Navigation');
        }
        else if(Platform.OS === 'web'){
            alert('Search Page Navigation');
        }
    }

  render() {
    return (
      <Container style={styles.headerColor}>
        <Left>
          <Text>
            Hello
          </Text>
        </Left>
      </Container>
    );
  }
}



const styles = StyleSheet.create({
    headerColor: {
        backgroundColor: 'white'
    },
    textColor: {
        color: 'black'
    }
});
